import axios from "axios";

export const submitHandlr = async (e, isLogin) => {
    const registerReq = axios
        .post('http://localhost:5000/users/register',
            {
                'email': 'email@email.com',
                'password': 'password1'
            },
                {headers: {
                    "Content-Type": "application/json",
                }}, 
            );

    const [data, error] = tryCatchHandlr();
};

async function tryCatchHandlr(promise){
    try{
        const data = await promise;

        return [data, null];
    }catch (error){

        return [null, error];
    }
}
